import re

import requests

# 로그인 이후 활용되는 쿠키
cookies = {
    '_ga': 'GA1.2.332137137.1648223162',
    '_gid': 'GA1.2.1111439236.1648223162',
    'etsid': 's%3AHjP1ms6SSuyIz3klzrcyB6RVYcisPbeg.cTs5VzjJHoA83ITKSiXAhP%2BIImcWR1oN145Dhrw53as',
}

headers = {
    'Connection': 'keep-alive',
    'sec-ch-ua': '" Not A;Brand";v="99", "Chromium";v="99", "Google Chrome";v="99"',
    'Accept': '*/*',
    'Content-Type': 'application/x-www-form-urlencoded; charset=UTF-8',
    'sec-ch-ua-mobile': '?0',
    'User-Agent': 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/99.0.4844.82 Safari/537.36',
    'sec-ch-ua-platform': '"Windows"',
    'Origin': 'https://everytime.kr',
    'Sec-Fetch-Site': 'same-site',
    'Sec-Fetch-Mode': 'cors',
    'Sec-Fetch-Dest': 'empty',
    'Referer': 'https://everytime.kr/',
    'Accept-Language': 'ko,en-US;q=0.9,en;q=0.8,ko-KR;q=0.7',
    # Requests sorts cookies= alphabetically
    # 'Cookie': '_ga=GA1.2.332137137.1648223162; _gid=GA1.2.1111439236.1648223162; etsid=s%3AHjP1ms6SSuyIz3klzrcyB6RVYcisPbeg.cTs5VzjJHoA83ITKSiXAhP%2BIImcWR1oN145Dhrw53as',
}
result = []
startNum = 0
limitNum = 50
while True:

    data = {
        'campusId': '55',
        'year': '2022',
        'semester': '1',
        'limitNum': f'{limitNum}',
        'startNum': f'{startNum}',
    }

    response = requests.post('https://api.everytime.kr/find/timetable/subject/list', headers=headers, cookies=cookies, data=data)

    # 결과값에서 정규식을 활용하여 강의id와 강의별점 추출,
    results = re.compile('lectureId="(\d+)" lectureRate="(\d.\d+|\d+)"').findall(response.text)

    # 강의내용이 없을경우 break문으로 빠져나가기
    if not results:
       break

    # lectureid가 0인 경우는 유효하지 않은 강의로 판단하여 제외
    # rate가 0인경우는 강의평이 없다고 판단하여 제외
    for x in [[lectureid, rate] for lectureid,rate in results if lectureid != '0' and rate != '0']:
        result.append(x)
    startNum += 50

